query:
CREATE TABLE `webhookEvents` (
	`id` varchar(36) NOT NULL,
	`tenantId` varchar(36) NOT NULL,
	`provider` varchar(50) NOT NULL,
	`eventType` varchar(100) NOT NULL,
	`payload` json NOT NULL,
	`headers` json,
	`processedAt` timestamp,
	`error` text,
	`createdAt` timestamp NOT NULL DEFAULT (now()),
	CONSTRAINT `webhookEvents_id` PRIMARY KEY(`id`)
);

CREATE INDEX `webhook_events_tenant_idx` ON `webhookEvents` (`tenantId`);
CREATE INDEX `webhook_events_provider_idx` ON `webhookEvents` (`provider`);
CREATE INDEX `webhook_events_created_idx` ON `webhookEvents` (`createdAt`);

